import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";

const UsersList = () => {
  const { users } = useSelector(({ users }) => users);
  console.log(users);
  return (
    <div>
      <ul>
        {users.map((u) => (
          <li>
            <article>
              <p>{u.login}</p>
            </article>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default UsersList;
